def format_cases(cases):
    # print(cases)
    new_cases = []
    for case in cases:
        r,c = case[0],case[1]
        # print(r,c)
        # print(case)
        new_cases.append(list(case[:2])+list(case[10:10+r*c]))
    return new_cases


